import React from 'react';
import Chatbot from './chatbotArea/ChatBotArea'
import './App.css';

function App({ settings }) {
  console.log(settings)
  return (
    <div className="App">
      <Chatbot userId={settings.userId} modelId={settings.modelId}/>
    </div>
  );
}

export default App;
